import React from "react";
import { Navbar,Nav,Button} from 'react-bootstrap';
import { useDispatch } from "react-redux";
import { Link } from "react-router-dom";
import { logout } from '../redux/actions/authActions';


const Navb = (props)=> {
    let {name}=props;
    let {tipo}=props;
    const dispatch = useDispatch()
    const handleLogout = (e) => {
        dispatch(logout());
    }
    return(
    <Navbar style= {{padding : "200px"}} fixed="top" bg="dark" variant="dark">
            <Navbar.Brand href="/home">Bienvenido {name}, {tipo}</Navbar.Brand>
            
            <Nav className="mr-auto">
                <Nav.Link href="/home">Home</Nav.Link>
                <Nav.Link href="/mensajes">Mensajes</Nav.Link>
                </Nav>
                <Nav>
                
                <Link to="/login">
                    <Button variant="danger" type="button" onClick={handleLogout}> LOG OUT </Button>
                </Link>
                </Nav>
            
            </Navbar>
    )
}

export default Navb
